Formula 1: The Impossible Collection dynamically highlights the most memorable events and people that have shaped the beloved sport. With forewords by Jean Todt, President of the FIA and Stefano Domenical, CEO of F1, this volume illuminates immortal names such as Juan Manuel Fangio, Jim Clark, Bruce McLaren, Enzo Ferrari, Colin Chapman, Bernie Ecclestone, Jackie Stewart, Niki Lauda, Alain Prost, Ayrton Senna, Michael Schumacher and Lewis Hamilton.

